import React, { Component } from "react";

import { Typography, Container, Paper, Grid } from "@material-ui/core";
import OwlCarousel from "react-owl-carousel2";
import "react-owl-carousel2/lib/styles.css";

import Slider from "react-slick";

class Blog extends Component {
  render() {
    return (
      <Container
        style={{
          marginTop: 80,
          height: "600px"
        }}
      >
        <Container
          style={{
            borderTopLeftRadius: "20px",
            borderBottomLeftRadius: "20px",
            backgroundColor: "#F1F0FF",
            width: "80%",
            height: "600px",
            right: 0,
            position: "absolute"
          }}
        >
          <Grid item xs={11} md={11}>
            <img
              style={{
                width: "500px",
                position: "absolute",
                top: "50%",
                height: "500px",
                left: -200,
                transform: "translateY(-50%)",
                borderRadius: "5px",
                border: "1px solid whitesmoke",
              }}
              src={require("../images/republika.jpg")}
              alt="slider-image"
            />
          </Grid>
        </Container>
        <Container
          style={{
            width: "55%",
            height: "400px",
            right: 0,
            position: "absolute",
            paddingTop: "40px"
          }}
        >
          <Typography
            component="h3"
            variant="h4"
            style={{ marginBottom: 20, fontWeight: 700, textAlign: "center" }}
          >
            Testimony
          </Typography>
          <Typography
            component="h2"
            variant="h3"
            style={{ color: "#EC9120", marginBottom: 20 }}
          >
            What Students Say About Us
          </Typography>
          <Typography component="h3" variant="h5" style={{ marginBottom: 20 }}>
            Minuteness of the parts
          </Typography>
          <Typography component="h3" variant="p" style={{ marginBottom: 20 }}>
            What looked like a small patch of purple grass, above five feet
            square, was moving across the sand in their direction. When it came
            near enough he perceived.
          </Typography>
        </Container>
      </Container>
      /* Testimony end */
    );
  }
}

export default Blog;
